INSERT INTO `sys_oper_log` VALUES (294, '翻译管理', 0, 'com.xjs.translation.controller.TranslationController.translation()', 'POST', 1, 'admin', '', '/translation', '127.0.0.1', '', '{\"q\":\"通用翻译API可为用户提供实时优质的多语言翻译服务，只需传入待翻译的内容，并指定要翻译的源语言（支持源语言语种自动检测）和目标语言，即可得到相应的翻译结果。\\n\\n现已支持200+语种互译，覆盖4万多个语言方向，可前往百度翻译官方网站体验。\\n\\n支持翻译结果同步至网盘保存，尊享版还可支持自定义术语、词典、语音合成等功能。\",\"translationType\":1}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"from\":\"zh\",\"to\":\"en\",\"transResult\":[{\"dst\":\"The general translation API can provide users with real-time high-quality multilingual translation services. Just pass in the content to be translated and specify the source language (supporting automatic detection of source language) and target language to be translated to obtain the corresponding translation results.\",\"src\":\"通用翻译API可为用户提供实时优质的多语言翻译服务，只需传入待翻译的内容，并指定要翻译的源语言（支持源语言语种自动检测）和目标语言，即可得到相应的翻译结果。\"}]}}', 0, '', '2021-12-27 17:10:41');
