INSERT INTO `sys_oper_log` VALUES (384, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"夫君子之行，静以修身，俭以养德，非淡泊无以明志，非宁静无以致远。\",\"createTime\":1640663162000,\"id\":1475674374546862082,\"source\":\"佚名\"}}', 0, '', '2021-12-28 13:05:55');
INSERT INTO `sys_oper_log` VALUES (385, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"雨下了那么多日，它没有弄湿过我，是我心底在雨季，我自己弄湿了自己。\",\"createTime\":1640663161000,\"id\":1475674367156498435,\"source\":\"三毛\"}}', 0, '', '2021-12-28 13:06:04');
INSERT INTO `sys_oper_log` VALUES (386, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我们从一惊一乍的孩童，变成了冷冷清清的大人。\",\"createTime\":1640663161000,\"id\":1475674368016330755,\"source\":\"佚名\"}}', 0, '', '2021-12-28 13:06:42');
INSERT INTO `sys_oper_log` VALUES (387, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"一无所有又怎样？我还有我的青春。\",\"createTime\":1640652600000,\"id\":1475630073569763330,\"source\":\"佚名\"}}', 0, '', '2021-12-28 13:07:18');
INSERT INTO `sys_oper_log` VALUES (388, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"无论这个世界对你怎样，都请你一如既往的努力、勇敢、充满希望。\",\"createTime\":1640663161000,\"id\":1475674369933127683,\"source\":\"毕淑敏 《愿你与这世界温暖相拥》\"}}', 0, '', '2021-12-28 13:07:55');
INSERT INTO `sys_oper_log` VALUES (389, '文案管理', 0, 'com.xjs.copywriting.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"生命只有一次，用尽全力，去做你想做的事，去成为你想成为的人。\",\"createTime\":1640663161000,\"id\":1475674369404645378,\"source\":\"佚名\"}}', 0, '', '2021-12-28 13:08:04');
