INSERT INTO `sys_oper_log` VALUES (464, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你的女朋友有缺点吗？  ：有，像星星一样的多。  那你的女朋友有优点吗？  ：有，像太阳一样的少。  那你为什么还喜欢她？ ：因为太阳一出现，星星就不见了。\",\"createTime\":1640705148720,\"id\":1475850478505648131,\"source\":\"亲爱的你\",\"type\":2}}', 0, '', '2021-12-28 23:25:48');
INSERT INTO `sys_oper_log` VALUES (465, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"高二那年班主任对我们说： 其实我并不反对你们谈恋爱， 只是你们记得要找一个有担当的， 那些一看见老师就松开你手的， 要来有什么用？\",\"createTime\":1640705205373,\"id\":1475850716146524163,\"source\":\"那些你很冒险的梦\",\"type\":2}}', 0, '', '2021-12-28 23:26:45');
INSERT INTO `sys_oper_log` VALUES (466, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"一颗沙里看出一个世界， 一朵野花里一座天堂， 把无限放在你的手掌上， 永恒在一刹那里收藏。\",\"createTime\":1640705278663,\"id\":1475851023526092803,\"source\":\"北岛\",\"type\":1}}', 0, '', '2021-12-28 23:27:58');
INSERT INTO `sys_oper_log` VALUES (467, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你知道有些鸟儿是注定不会被关在笼子里的，它的每一片羽毛，都闪烁着自由的光辉。\",\"createTime\":1640705288026,\"id\":1475851062801555459,\"source\":\"肖申克的救赎\",\"type\":1}}', 0, '', '2021-12-28 23:28:08');
INSERT INTO `sys_oper_log` VALUES (468, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"翟潇闻，新的一年，你也要每天开心哦[多多调皮]\",\"createTime\":1640705604707,\"id\":1475852391095689218,\"source\":\"赤脚追光\",\"type\":2}}', 0, '', '2021-12-28 23:33:24');
INSERT INTO `sys_oper_log` VALUES (469, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"把圈子变小，把语言变干净，把成绩往上提，把故事往心里收一收，现在想要的以后都会有。\",\"createTime\":1640705606519,\"id\":1475852398704156673,\"source\":\"绊\",\"type\":2}}', 0, '', '2021-12-28 23:33:26');
INSERT INTO `sys_oper_log` VALUES (470, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"大盗原来是个将军，但不愿意接受册封，想拿赏赐的明珠给喜欢的人当弹弓打鸟，但回家的途中得知喜欢的人已经死了，庭前只剩下枇杷树了。所以故乡近在一箭的距离，却不敢回去面对现实惶惶不可前。只好当了睥睨四野的大盗。 ――转自专辑封面。\",\"createTime\":1640705608000,\"id\":1475852404865589250,\"source\":\"盗将行\",\"type\":2}}', 0, '', '2021-12-28 23:33:28');
INSERT INTO `sys_oper_log` VALUES (471, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"中年以后的男人 时常会觉得孤独 因为他一睁开眼睛 周围都是要依靠他的人 却没有他可以依靠的人 ――张爱玲\",\"createTime\":1640705627363,\"id\":1475852486075703298,\"source\":\"父亲写的散文诗\",\"type\":2}}', 0, '', '2021-12-28 23:33:47');
INSERT INTO `sys_oper_log` VALUES (472, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你相信吗 也许在另一个平行时空 有一个跟你长得很像很像的人 正在热烈得爱着那个你爱不到的人\",\"createTime\":1640705628900,\"id\":1475852492534931459,\"source\":\"想见你想见你想见你\",\"type\":2}}', 0, '', '2021-12-28 23:33:48');
INSERT INTO `sys_oper_log` VALUES (473, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"每个人都有属于自己的时刻表，别让任何人打乱你人生的节奏。\",\"createTime\":1640705630400,\"id\":1475852498855747585,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-28 23:33:50');
INSERT INTO `sys_oper_log` VALUES (474, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你是一树一枯荣 是我最向往的温柔。\",\"createTime\":1640705631942,\"id\":1475852505281421314,\"source\":\"关山酒\",\"type\":2}}', 0, '', '2021-12-28 23:33:51');
INSERT INTO `sys_oper_log` VALUES (475, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我们生来孤独，有何苦闯进人群自取其辱。\",\"createTime\":1640705633230,\"id\":1475852510679490562,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-28 23:33:53');
INSERT INTO `sys_oper_log` VALUES (476, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我拼尽了所有，奇迹却没有发生。\",\"createTime\":1640705634380,\"id\":1475852515532300289,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-28 23:33:54');
