INSERT INTO `sys_oper_log` VALUES (635, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"年轻的时候，总是以为自己是全世界最棒的，肩负着惊天地泣鬼神的重任。年少时这些豪情狂妄而单纯，却那么有韵味，像早春旷野里的气息。\",\"createTime\":1640757692145,\"id\":1476070861600710658,\"source\":\"玻璃之城\",\"type\":3}}', 0, '', '2021-12-29 14:01:32');
INSERT INTO `sys_oper_log` VALUES (636, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你试图揭开其中的奥秘但是你永远不会知道真相因为..当然..你并不是真正在寻找其实.,,,. 你并不想知道解答你只是希望被 ...........骗\",\"createTime\":1640757698532,\"id\":1476070888423284738,\"source\":\"顶尖对决\",\"type\":3}}', 0, '', '2021-12-29 14:01:38');
