INSERT INTO `sys_oper_log` VALUES (669, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你偷吃我葡萄还葡我老母！\",\"createTime\":1640760032932,\"id\":1476080679602262018,\"source\":\"齐天大圣东游记\",\"type\":3}}', 0, '', '2021-12-29 14:40:32');
INSERT INTO `sys_oper_log` VALUES (670, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"在心动的期限里 仍对你存有无限幻想\",\"createTime\":1640760034528,\"id\":1476080686292176898,\"source\":\"重演\",\"type\":2}}', 0, '', '2021-12-29 14:40:34');
INSERT INTO `sys_oper_log` VALUES (671, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"相信青春是一生当中最快乐的时光，是一种谬误。最快乐的人是想着最有趣味的思想的人，因而我们是愈老愈快乐。\",\"createTime\":1640760035283,\"id\":1476080689421127682,\"source\":\"威廉·里昂·菲尔坡\",\"type\":4}}', 0, '', '2021-12-29 14:40:35');
INSERT INTO `sys_oper_log` VALUES (672, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"都说爱是积累来的 其实离开也是 比如我难过的时候你说好 我失眠的时候你依旧睡得早\",\"createTime\":1640760036500,\"id\":1476080694533984258,\"source\":\"有名无份\",\"type\":2}}', 0, '', '2021-12-29 14:40:36');
INSERT INTO `sys_oper_log` VALUES (673, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"其实失去了你我还能活 就是不想睡 不想醒 不想做梦 不想吃东西 不想做任何事 不想去任何地方 浑身无力 想逃避却发现无处可逃 想做些什么却发现什么都做不了 想倾诉些什么还是一句话也说不出口 想不去想你 可哪里都是你 想用尽全力的哭一场 却流不出一滴眼泪 我多久才能得到时光的救赎啊\",\"createTime\":1640760038784,\"id\":1476080704159911937,\"source\":\"还是分开\",\"type\":2}}', 0, '', '2021-12-29 14:40:38');
INSERT INTO `sys_oper_log` VALUES (674, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"夏花绚烂的时光，心灵的绿芜深处，偶来的一纸感念，流年里轻轻浅浅的印记，都是与自己心情有关的经历。安然静好的岁月，不知前方有多远，我只希望，能够漫过生命的长度，很远很远。\",\"createTime\":1640760105652,\"id\":1476080984616243202,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-29 14:41:45');
