INSERT INTO `sys_oper_log` VALUES (747, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我迎著朝野站在大海的面前，对自己说：如果时光不能倒流，就让这一切，随风而去吧。\",\"createTime\":1640761901848,\"id\":1476088518420893697,\"source\":\"三毛\",\"type\":1}}', 0, '', '2021-12-29 15:11:41');
