INSERT INTO `sys_oper_log` VALUES (759, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"立志是一件很重要的事情。工作随着志向走，成功随着工作来，这是一定的规律。立志、工作、成功是人类活动的三大要素。立志是事业的大门，工作是登堂入室的旅程，这旅程的尽头就有个成功在等待着，来庆祝你的努力结果……\",\"createTime\":1640766063336,\"id\":1476105972962553858,\"source\":\"巴斯德\",\"type\":4}}', 0, '', '2021-12-29 16:21:03');
