INSERT INTO `sys_oper_log` VALUES (769, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"人生的快乐和幸福不在金钱，不在爱情，而在真理。即使你想得到的是一种动物式的幸福，生活反正不会任你一边酗酒，一边幸福的，它会时时刻刻猝不及防地给你打击。\",\"createTime\":1640775204901,\"id\":1476144315471978498,\"source\":\"契诃夫\",\"type\":4}}', 0, '', '2021-12-29 18:53:25');
INSERT INTO `sys_oper_log` VALUES (770, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你抱怨生活的时候，生活也在嘲笑你。\",\"createTime\":1640775207604,\"id\":1476144326796599297,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-29 18:53:27');
INSERT INTO `sys_oper_log` VALUES (771, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我究竟是忘了你273天，直到今天才偶然想起你。还是这273天的思念全部被这首歌点燃。晚安，我还是躺在这属于我的猪圈里，今夜无眠。\",\"createTime\":1640775208854,\"id\":1476144332039479299,\"source\":\"醒着醉\",\"type\":2}}', 0, '', '2021-12-29 18:53:28');
INSERT INTO `sys_oper_log` VALUES (772, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"自我介绍一下，我岁数已经不小了，留学生身份出去的，在国外生活过十几年，没正经上过学，蹉跎中练就一身生存技能，现在学无所成海外归来，实话实说，应该定性为一只没有公司、没有股票、没有学位的“三无伪海龟”。性格open，人品五五开，不算老实，但天生胆小，杀人不犯法我也下不去手，总体而言属于对人群对社–会有益无害的一类。\",\"createTime\":1640775209719,\"id\":1476144335633997827,\"source\":\"非诚勿扰\",\"type\":3}}', 0, '', '2021-12-29 18:53:29');
