INSERT INTO `sys_oper_log` VALUES (820, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"该隐和亚伯有自己的后代。在人类的伟大悲剧中，该隐是反对派。您就从亚当这条根苗中传下来的子孙，魔鬼在这条根苗上继续吹旺火苗，而第一个火星已经落到夏娃身上。在这房的子孙后代中，有时也出现一些可怕的魔鬼；他们有着强健的体魄，汇集了人类的一切力量，犹如沙漠中的猛兽，需要生活在广阔的天地之中。这些人在社会中十分危险，就像狮子突然出现在诺曼底地区一样：……\",\"createTime\":1640786811089,\"id\":1476192995356884993,\"source\":\"巴尔扎克\",\"type\":4}}', 0, '', '2021-12-29 22:06:51');
