INSERT INTO `sys_oper_log` VALUES (1017, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我觉得生命是最重要的，所以在我心里，没有事情是解决不了的。不是每一个人都可以幸运的过自己理想中的生活， 　　有楼有车当然好了，没有难道哭吗？ 　　所以呢，我们一定要享受我们所过的生活。\",\"createTime\":1640881259097,\"id\":1476589139010449409,\"source\":\"新不了情\",\"type\":3}}', 0, '', '2021-12-31 00:20:59');
