INSERT INTO `sys_oper_log` VALUES (1075, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你不用那么优秀，拿的出手就行，有干劲满满的事业，有光明正大的爱情，有一二精致的喜好，过着并不窘迫的日子。\",\"createTime\":1640928161873,\"id\":1476785863508848641,\"source\":\"佚名\",\"type\":1}}', 0, '', '2021-12-31 13:22:41');
INSERT INTO `sys_oper_log` VALUES (1076, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"原来尘世间有很多烦恼是很容易解决的，有些事只要你肯反过来看，你会有另外一番光景。\",\"createTime\":1640932850193,\"id\":1476805527723012097,\"source\":\"天下无双\",\"type\":3}}', 0, '', '2021-12-31 14:40:50');
INSERT INTO `sys_oper_log` VALUES (1077, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"这首歌我不知道有多少人听过，当时我正在高速上开着车，忽然听到了这首歌，我猛踏油门到了200码，我决定给这首歌88分，剩下的12分给交警！\",\"createTime\":1640933015159,\"id\":1476806219648954369,\"source\":\"Да да да (Jarico Remix)\",\"type\":2}}', 0, '', '2021-12-31 14:43:35');
INSERT INTO `sys_oper_log` VALUES (1078, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"柳絮飘零，杜鹃哀啼，我听说你被贬到龙标，跋涉五溪。从此迢迢无期，不知何时归。\",\"createTime\":1640936615758,\"id\":1476821321664131074,\"source\":\"杨花落尽子规啼\",\"type\":2}}', 0, '', '2021-12-31 15:43:35');
INSERT INTO `sys_oper_log` VALUES (1079, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"只有在我们失去了一切之后，我们才可以做任何事。\",\"createTime\":1640936622911,\"id\":1476821351640821762,\"source\":\"斗阵俱乐部（搏击俱乐部)Fight Club\",\"type\":3}}', 0, '', '2021-12-31 15:43:42');
