INSERT INTO `sys_oper_log` VALUES (1201, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"好久不见，我们谈谈理想：我的理想是面朝大海也面朝你，种植葡萄也生产诗歌，酿造美酒也酿造宿醉，养小孩也养狗，放飞风筝也放飞自己，每天都在同一条街上遛弯也经常环游世界，时时怀有一个无限大无限美好的梦，但是每天早上都要自己煎鸡蛋和煮咖啡。 ​ \",\"createTime\":1641027410761,\"id\":1477202143511015425,\"source\":\"我的名字\",\"type\":2}}', 0, '', '2022-01-01 16:56:50');
INSERT INTO `sys_oper_log` VALUES (1202, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"上天不会给人再来一次的机会，因为再来一次结果并不会有什么不同。\",\"createTime\":1641027469895,\"id\":1477202391545376769,\"source\":\"佚名\",\"type\":1}}', 0, '', '2022-01-01 16:57:49');
INSERT INTO `sys_oper_log` VALUES (1203, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"诚实豆沙包，吃完了30秒之内说的话会诚诚实实，是90年代新科技的产品！\",\"createTime\":1641027510611,\"id\":1477202562316464129,\"source\":\"整人专家\",\"type\":3}}', 0, '', '2022-01-01 16:58:30');
INSERT INTO `sys_oper_log` VALUES (1204, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"昨日，我菲律宾工人走过市场，听到有个卖鱼的说有有个人叫做赌神，就是你。哈哈……我当场吓一跳，然后就大笑。这个世界，居然有人自称为赌神，这分明是当我笨蛋！我就叫赌圣，你赌牌都要戴隐形液晶体眼镜，我告诉你我可以直接看穿副牌，这就叫特异功能。这里有只a士，只要我轻轻一搓，就即刻变成一只皱了的a士，因为我还没发功嘛。我发功后还能变副麻将出。你话我瞎掰呀，我还说你虎烂\",\"createTime\":1641027608899,\"id\":1477202974570409985,\"source\":\"赌侠\",\"type\":3}}', 0, '', '2022-01-01 17:00:09');
