INSERT INTO `sys_oper_log` VALUES (1212, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"希望花花能不断在音乐上有新的突破，粉丝与你同在[亲亲] 花花的思想和精神世界真的比一般同龄人要成熟和纯粹许多。对自己的音乐也一直都是很自信并且很明确，就像他所说的“如果我每天都在思考保持初心的话，那就证明我已经没有初心了。” 活很通透一人，有自己对世界深刻的观察力和独特的理解方式。\",\"createTime\":1641027759086,\"id\":1477203604491935746,\"source\":\"好想爱这个世界啊\",\"type\":2}}', 0, '', '2022-01-01 17:02:39');
INSERT INTO `sys_oper_log` VALUES (1213, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"万夫一力，天下无敌。\",\"createTime\":1641027761567,\"id\":1477203614872838145,\"source\":\"刘基\",\"type\":4}}', 0, '', '2022-01-01 17:02:41');
INSERT INTO `sys_oper_log` VALUES (1214, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你想离开也请你告诉我，不要敷衍，让我有期盼，祝你前程似锦\",\"createTime\":1641027763921,\"id\":1477203624725258242,\"source\":\"老友记\",\"type\":2}}', 0, '', '2022-01-01 17:02:43');
INSERT INTO `sys_oper_log` VALUES (1215, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"每个人都有属于自己的时刻表，别让任何人打乱你人生的节奏。\",\"createTime\":1641027766392,\"id\":1477203635097772033,\"source\":\"佚名\",\"type\":1}}', 0, '', '2022-01-01 17:02:46');
INSERT INTO `sys_oper_log` VALUES (1216, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"星河滚烫你是人间理想\",\"createTime\":1641027851127,\"id\":1477203990502121473,\"source\":\"欧若拉\",\"type\":2}}', 0, '', '2022-01-01 17:04:11');
INSERT INTO `sys_oper_log` VALUES (1217, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"花满市，月侵衣，少年情事老来悲。\",\"createTime\":1641027854127,\"id\":1477204003085033474,\"source\":\"谁 (Live版)\",\"type\":2}}', 0, '', '2022-01-01 17:04:14');
INSERT INTO `sys_oper_log` VALUES (1218, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我们要学会珍惜我们生活的每一天，因为，这每一天的开始，都将是我们余下生命之中的第一天。除非我们即将死去。\",\"createTime\":1641027856771,\"id\":1477204014212521985,\"source\":\"美国心·玫瑰情( 美国美人)American beauty\",\"type\":3}}', 0, '', '2022-01-01 17:04:16');
INSERT INTO `sys_oper_log` VALUES (1219, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"【夕阳武士】武士：看来我不应该来。紫霞：现在才知道太晚了，武士：留下点回忆行不行？紫霞：我不要回忆，要的话留下你的人。武士：这样只是得到我的肉体，并不能得到我的灵魂，我已经有爱人了，我们不会有结果，你让我走吧。紫霞：好，我让你走，不过临走前你要亲我一下。(群众：亲啊…亲啊…)武士：我再怎么说也是个夕阳武士，妳叫我亲我就亲，那我的形象不是全毁了？！紫霞：你说谎\",\"createTime\":1641027928119,\"id\":1477204313471918082,\"source\":\"齐天大圣西游记\",\"type\":3}}', 0, '', '2022-01-01 17:05:28');
INSERT INTO `sys_oper_log` VALUES (1220, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"【一万年】曾经有一份真诚的爱摆在我的面前，但是我没有珍惜，等到失去的时候才后悔莫及，尘世间最痛苦的事莫过于此。如果上天可以给我个机会再来一次的话，我会对这个女孩说我爱她，如果非要在这份爱加上一个期限，我希望是一万年......\",\"createTime\":1641028039144,\"id\":1477204779098382337,\"source\":\"齐天大圣西游记\",\"type\":3}}', 0, '', '2022-01-01 17:07:19');
