INSERT INTO `sys_oper_log` VALUES (1227, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"天才就是劳动，人的天赋就像火花，它可以熄灭，也可以燃烧起来，而逼它燃烧成熊熊大火的方法只有一个，就是劳动再劳动。\",\"createTime\":1641029794252,\"id\":1477212140567433218,\"source\":\"高尔基\",\"type\":4}}', 0, '', '2022-01-01 17:36:34');
INSERT INTO `sys_oper_log` VALUES (1228, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"希望十年之后,那个陪你吃完年夜饭又一起看春晚,在一起迎接新年,一起过情人节的人 是你爱的 又爱你的人\",\"createTime\":1641029804901,\"id\":1477212185274519554,\"source\":\"拾忆\",\"type\":2}}', 0, '', '2022-01-01 17:36:44');
INSERT INTO `sys_oper_log` VALUES (1229, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"什么是权利？当一个人犯了罪，法官依法判他死刑。这不叫权利，这叫正义。而当一个人同样犯了罪，皇帝可以判他死刑，也可以不判他死刑，于是赦免了他，这就叫权利！\",\"createTime\":1641030154717,\"id\":1477213652500832258,\"source\":\"辛德勒名单(Schindler\'s list)\",\"type\":3}}', 0, '', '2022-01-01 17:42:34');
INSERT INTO `sys_oper_log` VALUES (1230, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"《人间失格》里有这样一句话：“若能避开猛烈的欢喜，自然也不会有悲痛的来袭”\",\"createTime\":1641030157381,\"id\":1477213663670263810,\"source\":\"下坠Falling\",\"type\":2}}', 0, '', '2022-01-01 17:42:37');
INSERT INTO `sys_oper_log` VALUES (1231, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"路在人走，业在人创，事在人为。\",\"createTime\":1640863080000,\"id\":1476512891001282562,\"source\":\"谚语\",\"type\":4}}', 0, '', '2022-01-01 18:06:50');
INSERT INTO `sys_oper_log` VALUES (1232, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"后来明白我是鲸，深海独自泅游，开始潆洄人间朝与暮，祈雨又盼晴。\",\"createTime\":1641031690012,\"id\":1477220091986403329,\"source\":\"佚名\",\"type\":1}}', 0, '', '2022-01-01 18:08:10');
INSERT INTO `sys_oper_log` VALUES (1233, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"高三那会，我跟我的初恋互相暗恋一年，她最爱的歌曲。高考后我跟她表白，直到现在。我们很好，准备16年结婚纪念我们的7年之痒\",\"createTime\":1641031732203,\"id\":1477220268939894785,\"source\":\"红色高跟鞋\",\"type\":2}}', 0, '', '2022-01-01 18:08:52');
