INSERT INTO `sys_oper_log` VALUES (1239, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"每次分别时最令人期待的都是下次见面，当我每次踏上旅途，为你翻山越岭也无心在意沿途风景，阳光跟随着我，思念在催促着我，直到温柔月光洒满夜空，直到我们都默契地说出那句“到时见”。我们一定会再见的，不管多久多远，我都一定会认出你，奔向你，拥抱你。\",\"createTime\":1641033257890,\"id\":1477226668126593025,\"source\":\"到时见\",\"type\":2}}', 0, '', '2022-01-01 18:34:17');
