INSERT INTO `sys_oper_log` VALUES (1321, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"理由 理由 理由 理由 再多理由 无法挽留 爱情 爱情 爱情 爱情 再多理由 说停就停 Ryan.B一直谱写着动人的歌曲\",\"createTime\":1641098530506,\"id\":1477500441329336322,\"source\":\"没有理由\",\"type\":2}}', 0, '', '2022-01-02 12:42:10');
