INSERT INTO `sys_oper_log` VALUES (1323, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"初见是惊鸿一瞥，南柯一梦是你。 等待是山重水复，怦然心动是你。 相遇是柳暗花明，如梦初醒是你。 重逢是始料未及，别来无恙是你。\",\"createTime\":1641098532249,\"id\":1477500448652591105,\"source\":\"花枝春野\",\"type\":2}}', 0, '', '2022-01-02 12:42:12');
INSERT INTO `sys_oper_log` VALUES (1324, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"人总是爱把短暂的东西说成永久的。\",\"createTime\":1641098532415,\"id\":1477500449315291138,\"source\":\"嚣张\",\"type\":2}}', 0, '', '2022-01-02 12:42:12');
