INSERT INTO `sys_oper_log` VALUES (1326, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"一个人使劲踮起脚尖靠近太阳的时候，全世界都挡不住她的阳光。\",\"createTime\":1641098532748,\"id\":1477500450703605761,\"source\":\"人民日报《你的坚持，终将美好》\",\"type\":1}}', 0, '', '2022-01-02 12:42:12');
