INSERT INTO `sys_oper_log` VALUES (1328, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"没有备胎，也不玩暧昧， 我把我所有的温暖和宽容， 淫荡和撒娇，眼泪和笑容， 好脾气和孩子气都给了你，可你还是离开了我，让我怎么再收拾好自己重新给别人， 可能要很久很久吧。\",\"createTime\":1641098533092,\"id\":1477500452159029249,\"source\":\"只能陪你到这里\",\"type\":2}}', 0, '', '2022-01-02 12:42:13');
