INSERT INTO `sys_oper_log` VALUES (1331, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"深深地感受到了《亲爱的，热爱的》这部剧真的很良心，每一首歌不同风格，但又很符合剧情内容！这首歌听着就让我想到了一群热血的年轻人为了梦想荣誉而默默奋斗的那些岁月，听着听着竟然也让人有些热血沸腾。7月9日，我们不见不散！\",\"createTime\":1641098533585,\"id\":1477500454268764161,\"source\":\"无名之辈\",\"type\":2}}', 0, '', '2022-01-02 12:42:13');
