INSERT INTO `sys_oper_log` VALUES (1349, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"爱情要懂得珍惜，随着岁月加倍的珍惜。爱情不是在明月之下闲散，也不是在长板凳上叹息。\",\"createTime\":1641113130968,\"id\":1477561680084533249,\"source\":\"施企巴乔夫\",\"type\":4}}', 0, '', '2022-01-02 16:45:30');
INSERT INTO `sys_oper_log` VALUES (1350, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"思想好比火星：一颗火星会点燃另一颗火星。一个深思熟虑的教师和班主任，总是力求在集体中创造一种共同热爱科学和渴求知识的气氛，使智力兴趣成为一些线索，以其真挚的、复杂的关系——即思想的相互关系把一个个的学生连接在一起。\",\"createTime\":1641113136705,\"id\":1477561704151449602,\"source\":\"苏霍姆林斯基\",\"type\":4}}', 0, '', '2022-01-02 16:45:36');
INSERT INTO `sys_oper_log` VALUES (1351, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"你越想知道自己是不是忘记的时候.你反而记得更清楚。\",\"createTime\":1641113140721,\"id\":1477561721004163074,\"source\":\"东邪西毒\",\"type\":3}}', 0, '', '2022-01-02 16:45:40');
INSERT INTO `sys_oper_log` VALUES (1352, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"早上起床后，请你先把自己沉睡的心打开，然后再把窗户打开。这样，户外的风才能吹进你的心扉。所以，每天，你要做的第一件事就是开心！\",\"createTime\":1641113141608,\"id\":1477561724745482241,\"source\":\"佚名\",\"type\":1}}', 0, '', '2022-01-02 16:45:41');
INSERT INTO `sys_oper_log` VALUES (1353, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"白日莫空过，青春不再来。\",\"createTime\":1641113142272,\"id\":1477561727513722882,\"source\":\"林宽\",\"type\":4}}', 0, '', '2022-01-02 16:45:42');
