INSERT INTO `sys_oper_log` VALUES (1411, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"从分手的那一天开始，我每天买一罐5月1号到期的菠萝罐头，因为菠萝是阿美最爱吃的东西，而5月1号是我的生日。我告诉我自己，当我买满30罐的时候，她如果还-不回来，这段感情就会过期。\",\"createTime\":1641434235859,\"id\":1478908491619000322,\"source\":\"重庆森林\",\"type\":3}}', 0, '', '2022-01-06 09:57:15');
INSERT INTO `sys_oper_log` VALUES (1412, '获取翻译', 0, 'com.xjs.translation.controller.TranslationController.translation()', 'POST', 1, 'admin', '', '/translation', '127.0.0.1', '', '{\"q\":\"从分手的那一天开始，我每天买一罐5月1号到期的菠萝罐头，因为菠萝是阿美最爱吃的东西，而5月1号是我的生日。我告诉我自己，当我买满30罐的时候，她如果还-不回来，这段感情就会过期。\",\"translationType\":2}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"elapsedTime\":145,\"errorCode\":0,\"transResult\":[{\"dst\":\"From the day began to break up, every day I buy a can of canned pineapple, due on May 1 for pineapple is may\'s favorite things, and my birthday is on May 1.\",\"src\":\"从分手的那一天开始，我每天买一罐5月1号到期的菠萝罐头，因为菠萝是阿美最爱吃的东西，而5月1号是我的生日。\"},{\"dst\":\"I told myself, when I buy 30 cans, she is - don\'t come back, if this relationship will be expired.\",\"src\":\"我告诉我自己，当我买满30罐的时候，她如果还-不回来，这段感情就会过期。\"}],\"type\":\"ZH_CN2EN\"}}', 0, '', '2022-01-06 09:57:36');
INSERT INTO `sys_oper_log` VALUES (1413, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"爱情要懂得珍惜，随着岁月加倍的珍惜。爱情不是在明月之下闲散，也不是在长板凳上叹息。\",\"createTime\":1641454441431,\"id\":1478993239955628034,\"source\":\"施企巴乔夫\",\"type\":4}}', 0, '', '2022-01-06 15:34:01');
INSERT INTO `sys_oper_log` VALUES (1414, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"不开心，就算长生不老也没用，开心，就算只能活几天也足够!\",\"createTime\":1641454468375,\"id\":1478993352962760705,\"source\":\"齐天大圣西游记\",\"type\":3}}', 0, '', '2022-01-06 15:34:28');
INSERT INTO `sys_oper_log` VALUES (1415, '获取翻译', 0, 'com.xjs.translation.controller.TranslationController.translation()', 'POST', 1, 'admin', '', '/translation', '127.0.0.1', '', '{\"q\":\"不开心，就算长生不老也没用，开心，就算只能活几天也足够!\",\"translationType\":2}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"elapsedTime\":29,\"errorCode\":0,\"transResult\":[{\"dst\":\"Not happy, even when he forever, happy, even your last few days are enough!\",\"src\":\"不开心，就算长生不老也没用，开心，就算只能活几天也足够!\"}],\"type\":\"ZH_CN2EN\"}}', 0, '', '2022-01-06 15:34:32');
INSERT INTO `sys_oper_log` VALUES (1416, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"如果他在坐牢，那是因为他想坐牢；如果他要杀你，你早就死了\",\"createTime\":1641455812713,\"id\":1478998991529205761,\"source\":\"重案对决 (Law abiding citizen)\",\"type\":3}}', 0, '', '2022-01-06 15:56:52');
