INSERT INTO `sys_oper_log` VALUES (1465, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"岁月的暖，漫过时间的河，抚过久闭的心扉，我在时光斑驳处，聆听到花开的声音。\",\"createTime\":1641471725832,\"id\":1479065736003141633,\"source\":\"佚名\",\"type\":2}}', 0, '', '2022-01-06 20:22:05');
