INSERT INTO `sys_oper_log` VALUES (1467, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"英雄主义是在于为信仰和真理而牺牲自己。\",\"createTime\":1641472060807,\"id\":1479067140956569601,\"source\":\"托尔斯泰\",\"type\":4}}', 0, '', '2022-01-06 20:27:40');
