INSERT INTO `sys_oper_log` VALUES (1473, '获取文案', 0, 'com.xjs.copywriting.controller.CopyWritingController.copyWriting()', 'GET', 1, 'admin', '', '/copyWriting', '127.0.0.1', '', '', '{\"msg\":\"操作成功\",\"code\":200,\"data\":{\"content\":\"我的意中人是个盖世英雄，有一天他会踩着七色的云彩来娶我，我猜中了前头，可是我猜不着这结局……\",\"createTime\":1641474080071,\"id\":1479075610393001986,\"source\":\"齐天大圣东游记\",\"type\":3}}', 0, '', '2022-01-06 21:01:20');
